import React from "react";
import { Link, Routes, Route, Navigate } from "react-router-dom";
const HeaderComponent = () => {
  return (
    <div>
      <header>
        <nav
          className="navbar navbar-expand-lg"
          style={{ backgroundColor: " black" }}
          data-bs-theme="dark"
        >
          <div className="container-fluid">
          <p className="text-light" style={{ fontSize: "24px" }}>Salary Management System</p>
            <button
              className="navbar-toggler"
              type="button"
              data-bs-toggle="collapse"
              data-bs-target="#navbarNav"
              aria-controls="navbarNav"
              aria-expanded="false"
              aria-label="Toggle navigation"
            >
              <span className="navbar-toggler-icon"></span>
            </button>
            <div
              className="collapse justify-content-end me-5 navbar-collapse"
              id="navbarNav"
            >
              <ul className="navbar-nav">
                {
                  <li className="nav-item mx-4">
                    <Link
                      style={{
                        color: "white",
                        fontSize: "16px",
                        textDecoration: "none",
                      }}
                      to={"/home"}
                    >
                      Home
                    </Link>
                  </li>
                }

                {
                  <li className="nav-item mx-4 ">
                    <Link
                      style={{
                        color: "white",
                        fontSize: "16px",
                        textDecoration: "none",
                      }}
                      to={"/contact"}
                    >
                      Contact
                    </Link>
                  </li>
                }
                <li className="nav-item mx-4">
                  <Link
                    style={{
                      color: "white",
                      fontSize: "16px",
                      textDecoration: "none",
                    }}
                    to={"/about"}
                  >
                    About
                  </Link>
                </li>
                <li className="nav-item mx-4">
                  <Link
                    style={{
                      color: "white",
                      fontSize: "16px",
                      textDecoration: "none",
                    }}
                    to={"/Login"}
                  >
                    Login/Registration
                  </Link>
                </li>
          
                <li className="nav-item mx-4">
                  <Link
                    style={{
                      color: "white",
                      fontSize: "16px",
                      textDecoration: "none",
                    }}
                    to={"/login"}
                    // onClick={logOutAction}
                  >
                    Log Out
                  </Link>
                </li>
              </ul>
            </div>
          </div>
        </nav>
      </header>
    </div>
  );
};

export default HeaderComponent;
